import React from "react";
import Collapsible from "./Toggle";

function App() {
  return (
    <Collapsible label="About Us">
      <Collapsible label="How does Parkname seperate itself from other domain name parking companies?"></Collapsible>
    </Collapsible>
  );
}

export default App;
